@Component({
  selector: 'app-task3',
  templateUrl: './task3.component.html',
  styleUrls: ['./task3.component.css']
})
export class Task3Component {
  languages = ['html', 'css', 'js', 'php'];
}
<h2>Мови програмування:</h2>
<ul>
  <li *ngFor="let lang of languages">{{ lang }}</li>
</ul>
